import { formatDate, formatLongDate } from "react-calendar/dist/cjs/shared/dateFormatter";
import CalendarApp from "../Calendar/Calendar";
import classes from "./Time.module.css"


function Time () {
    const current = new Date();
    const date = `${current.getDay()}/${current.getDate()}/${current.getMonth()+1}/${current.getFullYear()}`;
    const formatDate = formatLongDate("DDD-MMM-YYYY",date)

    return (
        <div>
            <div className={classes.time_container}>
            <h2>13:56:00</h2>
            <h3>{formatDate}</h3>
            <CalendarApp/>
            </div>
        </div>
    )
};

export default Time;
